import React from 'react';
import './Button.module.scss';

const Button = ({
    children,
    href 
}) => (
    <>
    {
        href ? (
            <a 
                target="_blank" 
                rel="noopener noreferrer"
                className={styles.button}
            >
                {children}</a>
        ) : (
            <button  className={styles.button}>{children}</button>
        )
    }  
    </>
);

export default Button;
